import React from 'react';
import ReactDOM from 'react-dom';
import './style.sass';


class Camera extends React.Component {
  render() {
    return (
      <div>
        <img src={this.props.img}></img>
      </div>
    );
  }
}

// ========================================

ReactDOM.render(
  <Camera />,
  document.getElementById('root')
);
